    private static List<CsvFile> parse(String filePath) {

        ArrayList<CsvFile> csvFileList = Lists.newArrayList();
        InputStreamReader in;

        try {
            in = new InputStreamReader(new FileInputStream(filePath), "GBK");
            BufferedReader bufferedReader = new BufferedReader(in);
            String line;
            while ((line = bufferedReader.readLine()) != null) {
                String[] split = line.split(",");
                CsvFile csvFile = new CsvFile();
                csvFile.setId(splitResult(split[0]));
                csvFile.setToken(splitResult(split[1]));
                csvFile.setType(splitResult(split[2]));
                csvFile.setDueTime(splitResult(split[3]));
                csvFile.setStatus(splitResult(split[4]));
                csvFile.setGmtCreate(splitResult(split[5]));
                csvFile.setGmtModified(splitResult(split[6]));
                csvFileList.add(csvFile);
            }

        } catch (IOException unsupportedEncodingException) {
            unsupportedEncodingException.printStackTrace();
        }

        return csvFileList;

    }

    private static String splitResult(String once) {
        StringBuilder result = new StringBuilder();
        for (int i = 0; i < once.length(); i++) {
            if (once.charAt(i) != '"') {
                result.append(once.charAt(i));
            }
        }
        return result.toString();
    }


